import React from "react";
import "./Header.css";
import ShoppingBasketIcon from '@mui/icons-material/ShoppingBasket';
function Header() {
  return (
    <div className="header">
        <h3>
        Hello Haris
        </h3>

        <div className="header__optionBasket">
            <ShoppingBasketIcon />
        </div>
      </div>
  );
}

export default Header;
